import React from 'react'
import LinksBeforeLogin from './LinksBeforeLogin'
import LinksAfterLogin from './LinksAfterLogin'
import { Container, Nav, Navbar } from 'react-bootstrap';

export default function HeadNav() {
    var links;
    var isLogin = false;
    if(localStorage.getItem('isLoggedIn') == 'true'){
        links = <LinksAfterLogin/>;
        var isLogin = true;
    }
    else{
        links = <LinksBeforeLogin/>;
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid">
                    <a className="navbar-brand" href={isLogin ? '/dashboard' : '/'}>Navbar</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon" />
                    </button>
                    <div className="collapse navbar-collapse" id="navbarText">
                        <ul className="navbar-nav">
                            {links}
                        </ul>
                    </div>
                </div>
            </nav>

            <Navbar collapseOnSelect expand="lg" className="bg-body-tertiary">
                <Container>
                    <Navbar.Brand href={isLogin ? '/dashboard' : '/'}>Navbar</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="me-auto">
                            <Nav.Link href="#features">Features</Nav.Link>
                            <Nav.Link href="#pricing">Pricing</Nav.Link>
                        </Nav>
                        <Nav>
                            <Nav.Link href="#deets">More deets</Nav.Link>
                            <Nav.Link eventKey={2} href="#memes">
                                Dank memes
                            </Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar>
        </>
        
        
    )
}
